import React, { Component } from 'react';
import logo from './../img/logo.svg';
import Nav from './Nav';
import Header from './Header';
import GameList from './GameList';
import Footer from './Footer';

class App extends Component {
  render() {
    return (
      <div className="App" id="page-top">
        <Nav />
        <Header />
        <GameList />
        <Footer />
      </div>
    );
  }
}

export default App;
